IF OBJECT_ID('dbo.proc_transform_496', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_496;
GO
CREATE PROCEDURE dbo.proc_transform_496
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_496
    SET payload = LEFT(payload, 1000) + N'|V4-496|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_496;
END
